■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください    <table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>手袋のままでお掃除をします!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5007an-01.jpg" width="600" height="488"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">【証明書】<br>世界的な織物証明機関スイスOeko-Texstandard100の検査にてレベル2=肌に直接触れる(昼着や寝着・シャツ・ブラウス・下着・装飾品やタオル類です)を所得し、製品には証明書タグが付けられています。<br><br>【ご使用上の注意】<br>●洗濯機にかけますと、ほつれる可能性がございますので、手洗いをお薦めします。<br>●乾燥機のご使用は、避けてください。<br>●洗濯を重ねるごとに、汚れの吸収効果は、落ちてくる可能性がございます。<br>●ほつれ部が現れた場合jは、引っ張らずに、かぎ針などで、中に押し込むようにしてください。<br><br><br>使用例<br>清掃：　車、車内、テレビ、液晶画面、植物、家具、ブラインド、窓、鏡、CD、ストーブ、オーブン、冷蔵庫、キャビネット、時計、携帯電話、等<br>磨き：　コンピュータ、PDP、MP3、宝石、アクセサリー、メガネ、靴、花瓶、等<br>吸水：　風呂上りの体拭き、髪の毛の吸水、赤ちゃん、介護時の体拭き<br>ふきん：　コップ、お皿、はし、スプーン、ファオーク等、食器の乾燥にふきんとして</font></td></tr></table><br><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5007an-02.jpg" width="546" height="600"></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5007an-03.jpg" width="472" height="375"><br><font size=3>ノートPC</font></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5007an-04.jpg" width="472" height="373"><br><font size=3>エアコン</font></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5007an-05.jpg" width="472" height="390"><br><font size=3>メーター</font></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5007an-06.jpg" width="472" height="379"><br><font size=3>一眼レフ</font></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5007an-07.jpg" width="587" height="600"><br><font size=3>照明</font></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5007an-08.jpg" width="311" height="308"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">髪の毛の100分の1の太さである超極細繊維を使用した手袋です。吸収性に優れるだけでなく、柔らかく、ほんのりとした艶やかさのある繊維です。そのまま手袋として使用していても、手触りがよく暖かいのですが本来の機能と特性において、あらゆる掃除に適し、そのまま洗濯できます。スイスに本部があるエコテックス規格100に基づく認証タグ付き。</font></td></tr></table></td></tr></table><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">髪の毛の100分の1の太さである超極細繊維を使用した手袋です。吸収性に優れるだけでなく、柔らかく、ほんのりとした艶やかさのある繊維です。そのまま手袋として使用していても、手触りがよく暖かいのですが本来の機能と特性において、あらゆる掃除に適し、そのまま洗濯できます。スイスに本部があるエコテックス規格100に基づく認証タグ付き。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">24cm×14cm</font><br><font color="#333333" size="-1">個装サイズ：28×15×2cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">60g×4</font><br><font color="#333333" size="-1">個装重量：240g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ポリエステル100％</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="